def countWinningPlayers(n, pick):
    # Dictionary to store the count of balls picked by each player for each color
    player_counts = {}

    # Update the counts based on the picks
    for player, color in pick:
        if player not in player_counts:
            player_counts[player] = {}
        if color not in player_counts[player]:
            player_counts[player][color] = 0
        player_counts[player][color] += 1

    # Function to check if a player wins
    def wins(player):
        required_balls = player + 1
        for count in player_counts[player].values():
            if count >= required_balls:
                return True
        return False

    # Count the number of winning players
    winning_players = sum(1 for player in range(n) if wins(player))

    return winning_players

